      "releasedBy": "",
      "forward": "The Office of the Director of Public Prosecutions, Kenya (ODPP) has long recognised that wildlife and forestry crime is a form of organised transnational crime, requiring strong investigations and robust prosecutions. Having instituted the 1 st Interagency Forum on Wildlife Related Crimes in 2013 which brought together key agencies, the ODPP, together with Kenya Wildlife Service, the National Police Service, the Kenya Revenue Authority, Department of Immigration Services, Attorney General’s Office, and Judiciary worked together to develop the first edition of the Rapid Reference Guide To Wildlife Crime, designed and initiated by Shamini Jayanathan,Barrister-at-Law with the British High Commission. Encompassing all relevant offences under existing laws at the time of publication in 2015, this was intended to be a quick reference guide for investigators and prosecutors alike.That this guidance is now in its third edition and additional volumes are being developed to include forestry and marine crime and even fisheries offences, is testament to its utility. This is further borne out by this model being replicated across the continent and even further afield.I am proud to be associated with this Rapid Reference Guide that will undoubtedly continue to serve as a valuable resource to investigators and prosecutors and I wish to commend its use to all of the stakeholders involved in the fight to protect Kenya’s natural heritage.With grateful acknowledgement to my team within the ODPP, the Kenya Wildlife Service, the United Nations Office of Drugs and Crime and Space for Giants in their tireless efforts to keep abreast of the developments in this important and increasingly complex area of crime.",
