      "releaseDate": "2023-07-05",
      "releasedBy": "",
      "forward": "Biodiversity loss is a global phenomenon in most countries of the world and has received concern in recent years owing to its threat of genetic erosion of soil fauna and flora, marine and aquatic species, social-economic poverty, deprivation of rural communities, poaching, forest and land degradation,bush fire, increase in illegal trafficking of wildlife, ecosystem imbalance, environmental pollution, habitat modifications, and alteration, national security, and public health risks, terrorism, climate change,reduction in national Gross Domestic Product accrued revenue coming from legal trade in these species.Nigeria is rich in wildlife resources ranging from unique endemic species found across different vegetation belts in the country. Despite this, Nigeria, in recent years is known to be a source, consumption, and destination hub and is currently battling the menace of illegal wildlife crime within its exit borders, in recent years.However, Nigeria has evolved several mechanisms to combat illegal wildlife trade through the setting up of the Joint Task Force in combating illegal wildlife trade, committee on seizure,participation in world wildlife day and other days celebration, harmonization of states wildlife laws with Federal Laws, aggressive sensitization awareness campaign, and the about to be completed Memorandum of Understanding (MOU) in fighting cross border ecosystem in forestry wildlife between the Government of Nigeria and Cameroon, the establishment of critical National Stakeholders’Forum of relevant MDAs in combatting illegal wildlife trade and strengthening enforcement capacity through the administration of training for Investigators, Prosecutors, Judges, and the Nigeria Customs Service and National Environmental Standards and Regulations Enforcement Agency (NESREA). The outcome of these interventions has led to the recent arrest and seizure of wildlife specimens at different border posts.Nigeria Launched its National Strategy to combat wildlife and Forest Crime in Nigeria (2022- 2026) with sets out Seven objectives which include: institutional commitment, defined organizational structures, and capabilities to effectively address both transnational and domestic wildlife crime. The second objective seeks to strengthen the Legal Framework as this will enable legal and sustainable trade, protect Nigeria’s fauna and flora, and deter wildlife crime through a harmonized and strengthened legal framework.The development of Nigeria’s Wildlife Crime Rapid Reference Guide for Investigators, Prosecutors,and Judges is timely as this will not only help harmonize the existing legal framework in enforcement and prosecuting environmental criminal syndicates but also serve as a Standard Operating procedure (SOP) for the prevention, investigation, and prosecution of wildlife crime thereby reducing the lengthy investigation and prosecution time.I will like to commend the collaboration of all critical stakeholders who have worked assiduously with the Federal Ministry of Environment in the production of this document; the United Nations Office on DrugsWildlife Crime in Nigeriaiv and Crime, Africa Nature Investors (ANI) Foundation, National Park Service, NESREA, Nigeria Customs Service (NCS), Federal Ministry of Justice DPP, Cross Rivers State DPP, and Lagos State DPP.Special thanks to our Development Partner, the German Government for the release of funds at different stages of production of this document. I believe the efforts put into the production of this document will facilitate prompt prosecution of illegal wildlife crime cases in Nigeria.",
