      "title": "Rapid Reference Guide For the investigation and prosecution of wildlife crime in the Philippines",
      "subTitle": "",
      "description": "Rapid Reference Guide For the investigation and prosecution of wildlife crime in the Philippines",
      "country": "Philippines",
      "image": "RRG_Philippines_09_18_Dec_2020.png",
      "downloadable": true,
      "pdfURL": "RRG_Philippines_09_18_Dec_2020.pdf",
      "offline": true,
