      "version": 1,
      "releaseDate": "2023-07-05",
      "releasedBy": "",
      "forward": "Wildlife trafficking is a serious crime affecting Southeast Asia and the whole World. The Republic ofthe Philippines is not immune to the detrimental effects that wildlife trafficking has on theenvironment, on the rule of law and on human health. By illegally taking wild animals from theirnatural ecosystem and bringing them to our cities for commercial purposes we are exposing oursociety to risks that cannot be controlled, under-pinning the need to combat the illegal trade of wildflora and fauna as a battle to protect the planet and the health of our society.The Rapid Reference Guide for the investigation and prosecution of wildlife crime in the Philippines isa practical tool to improve the way in which the most serious forms of wildlife crimes are handled inline with our legal framework, with our procedures and with our legal tradition. The Guide willundoubtedly serve as a valuable resource for investigators and prosecutors and I encourage its use toall stakeholders involved in the fight against the scourge of wildlife crime.This Guide has been developed during the months of lockdown and restrictive measures enforcedacross the Country after the outbreak of the COVID-19 pandemic. For this reason, I would like toextend my gratitude to all those experts that despite existing restrictions on face-to-face interactionshave lent their support to the development of this important document.We thank the United Nations Office on Drugs and Crime, which worked very closely with theBiodiversity Management Bureau to develop this Guide through consultation with a number of legalexperts and practitioners across the country. We are also pleased that the Guide has been turned intoan application for mobile phones and tablets, with a view to make it even more accessible to allinvestigators and prosecutors across the Philippines.The Government of the Philippines remains committed to preserve the rich biodiversity of the Countryand to be an active player in the global efforts to combat the illegal trade in endangered wildlife.",
      "acknowledgement": "The United Nations Office on Drugs and Crime (UNODC) wishes to express appreciation to all involved in the development and facilitation of the Rapid Reference Guide for the investigation and prosecution of wildlife crime in the Philippines.The development of the Guide was supported by Mr. Ray A. Cimatu, Secretary of Environment and Natural Resources and it was spearheaded by Mr. Ricardo L. Calderon, OIC Assistant Secretary for Climate Change and concurrent Director of the Biodiversity Management Bureau (BMB) of the Department of Environment and Natural Resources (DENR). Mr. Calderon appointed a working group lead by Atty. Theresa Tenazas, OIC of the Wildlife Resources Division, which was responsible for ensuring the involvement and consultation of all relevant departments of the Government at national and provincial levels. The tireless effort, dedication, and level of devotion of the working group, which undertook this task in a period of lockdown and adjustments related to a global pandemic including a new normal of remote meetings, is recognized and is highly valued.UNODC is also grateful to the various Government institutions and organizations that supported and participated in the validation process, including the Anti-Money Laundering Council Secretariat, Bureau of Customs, National Bureau of Investigations, National Prosecution Service under the Department of Justice, Office of the Special Envoy on Transnational Crime, Philippine Coast Guard, Philippine National Police, and the ADB/GEF-DENR project on Combating Environmental Organized Crime in the Philippines.The development and facilitation of the Rapid Reference Guide was led by international consultant Salvatore Amato, along with the valuable assistance of national experts Andrew Felix Arsenio A. De Castro, C. Therese Guiao and Justine Nicole Torres.UNODC facilitated this process through its Global Programme for Combating Wildlife and Forest Crimes and the involvement of its staff Giovanni Broussard, Zhiqiang Tao and Christel Joy Martinez.The Rapid Reference Guide was made possible thanks to a generous contribution from the Bureau of International Narcotics and Law Enforcement Affairs (INL) of the United States Department of State.",
